import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import NavBar from './components/NavBar';
import MainContent from './components/MainContent';

function App() {

  return (
    <>
      <NavBar />
      <Container>
        <MainContent /></Container>
    </>
  );
}

export default App;
